import { Component } from '@angular/core';
import { NgbActiveModal } from '@ng-bootstrap/ng-bootstrap';
import { Router } from '@angular/router';

@Component({
  selector: 'ic-time-out-dialog',
  templateUrl: './time-out-dialog.component.html',
})
export class TimeOutDialogComponent {
  constructor(public activeModal: NgbActiveModal, private router: Router) {}

  clear(): void {
    this.activeModal.dismiss('cancel');
    this.router.navigate(['']);
  }
}
<div class="modal-header">
  <h4 class="modal-title" icTranslate="idle.timeouttitle">Session expired</h4>
  <button type="button" class="close" data-dismiss="modal" aria-hidden="true" (click)="clear()">&times;</button>
</div>
<div class="modal-body">
  <ic-alert-error></ic-alert-error>
  <p icTranslate="idle.timeoutcontent">You have been logged out because your session has expired</p>
</div>
<div class="modal-footer">
  <button type="button" class="btn btn-warning" data-dismiss="modal" (click)="clear()">
    <fa-icon [icon]="'ban'"></fa-icon>&nbsp;<span icTranslate="idle.proceedbutton">ok</span>
  </button>
</div>
